import { Link } from 'react-router-dom';

const Main = () => {
  return (
    <>
      <div>
        <h1>Main</h1>
        <a href="/intro">소개</a>
        <Link to="/intro">소개</Link>
      </div>
    </>
  );
};
export default Main;
